This is useful mainly in C, because in C++ you can just leave the variable unnamed. However, there are situations where this can be useful even in C++, such as void
MyClass::Method(intfoo)
{
#ifdefined(__APPLE__)
TF_UNUSED(foo);
//dosomethingthatdoesn'tneedfoo...
#else
//dosomethingthatneedsfoo
#endif
}
